import axios from "axios";

function GetSchedulerData () {
        console.log("AHHHAHAHAH");
        axios.get("http://localhost:7777/api/scheduler", {crossDomain: false}).then((response) =>{
        console.log(response.data);
        return response.data;
    })
}
    

export { GetSchedulerData };
